import React, {
  useState,
  useEffect,
} from "react";

export default function Products() {
  const [products, setProducts] =
    useState([]);
  useEffect(() => {
    fetch(
      "http://example.com/movies.json"
    )
      .then((response) =>
        response.json()
      )
      .then((data) =>
        console.log(data)
      );
  }, []);

  return (
    <div>
      <ul>
        {products.map((p) => (
          <li>{p.name}</li>
        ))}
      </ul>
    </div>
  );
}
